import React from 'react'
import './Skills.css'
export default function Skills() {
    const Skills=["HTML","CSS","JavaScript","React.js"
        ,"Java","XML","Servlets","JSP","Spring Boot",
        "Spring Data JPA","Spring Data Mongodb",
        "Spring MVC","MySQL","Microservices Architecture",
        "REST API","Apache Kafka","Git","Git Hub"
    ]
  return (
    <div className='Skills'>
        <marquee></marquee>
        <div className='Skill-Container'>
        {Skills.map(skill=>(
            <div>{skill}</div>
        ))}
    </div>
    
    </div>
  )
}
